import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route, 
  Link
} from 'react-router-dom'
import {InfoPanel} from './layout/infoPanel.layout'
import Navbar from './components/navbar'
import './App.css';

import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <Router>
    <div className="App">
    <Navbar />
    <Routes>

    <Route exact path="/home" element={<InfoPanel/>} />
    <Route exact path="/contacto" element={<h1>pagina de contacto</h1>}/>


        </Routes>
    </div>
    </Router>
  );
}

export default App;
